    inputStream?.delegate = nil
    if let stream = inputStream {
        CFReadStreamSetDispatchQueue(stream, nil)
        stream.close()
    }
    if let stream = outputStream {
        CFWriteStreamSetDispatchQueue(stream, nil)
        stream.close()
    }
    outputStream = nil
    inputStream = nil
    fragBuffer = nil
